    /**
     * Returns a FilesValue with the given value. For a specific value the 
     * returned object will always be a singleton so reference equality 
     * is satisfied when the values are the same.
     * 
     * @param value value to be wrapped as FilesValue
     */ 
    @JsonCreator
    public static FilesValue of(String value) {
        synchronized (FilesValue.class) {
            return values.computeIfAbsent(value, v -> new FilesValue(v));
        }
    }

